import React from 'react';
import { Link } from 'react-router-dom';

const DashboardPage = () => {
  return (
    <div>
      <h2>Dashboard Page</h2>
      <p>Welcome to the dashboard!</p>
      <Link to="/">Home</Link>
    </div>
  );
};

export default DashboardPage;
